const Rodape = () => {
    return (
        <footer className="rodape container">
            <h2>Contate-nos</h2>
            <ul>
                <li>@pataverde</li>
                <li>(11) XXXX-XXXX</li>
                <li>Facebook: @pataverde</li>
            </ul>
        </footer>
    );
};

export default Rodape;
